import React from 'react';
import { Link } from 'react-router-dom';

const Home: React.FC = () => {
  return (
    <div className="bg-white shadow-md rounded-lg p-6">
      <h1 className="text-3xl font-bold mb-4">Welcome to MediAssist AI</h1>
      <p className="mb-6 text-gray-600">
        MediAssist AI is a cutting-edge medical application that leverages artificial intelligence to assist healthcare professionals in diagnosis, report generation, and treatment planning.
      </p>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <Link to="/diagnosis" className="bg-blue-100 p-4 rounded-lg hover:bg-blue-200 transition-colors">
          <h2 className="text-xl font-semibold mb-2">Diagnosis</h2>
          <p className="text-gray-600">Upload X-ray images and patient data for AI-assisted diagnosis.</p>
        </Link>
        <Link to="/synthetic-report" className="bg-green-100 p-4 rounded-lg hover:bg-green-200 transition-colors">
          <h2 className="text-xl font-semibold mb-2">Synthetic Report</h2>
          <p className="text-gray-600">Generate synthetic medical reports for research and training purposes.</p>
        </Link>
        <Link to="/treatment-plan" className="bg-purple-100 p-4 rounded-lg hover:bg-purple-200 transition-colors">
          <h2 className="text-xl font-semibold mb-2">Treatment Plan</h2>
          <p className="text-gray-600">Create personalized treatment plans based on patient data.</p>
        </Link>
      </div>
    </div>
  );
};

export default Home;
